import { Stack } from "@mui/material";
import { Box } from "@mui/system";
import { Icon } from '@iconify/react';


function Selector()
{
    return(
        <Stack
            direction="row"
            justifyContent="center"
            alignment="center"
            m={25}

        >
            <Box m={25} component="span" sx={{ width:200,height:200 , boxShadow:2}}>

                    <Icon icon="bi:mic-fill" color="blue" width="200" height="200" />
            </Box>   

            <Box m={25} component="span" sx={{p: 2, border: '1px dashed grey' , width:200,height:200}}>
            <Icon icon="bi:upload" color="blue" width="200" height="200" />

            </Box>   

        </Stack>
    );
}

export default Selector;
